		/* 팝업 내용 스크롤 다운 시 처리 */
		function popupScrollDown(evt){
			evt.preventDefault();
			evt.stopPropagation();
			popupEventType='scroll';
			scrollTarget=evt.currentTarget;
			scrollbarMc=scrollTarget.parent;
			scrollTxtMc=scrollbarMc.parent.txtMc;
			scrollStartYpos=evt.stageY;
			scrollbarStartYpos=scrollTarget.y;
			defaultScrollbarYpos=0;
			scrollMaxYpos=scrollbarMc.getBounds().height-scrollTarget.getBounds().height;
			scrollTxtMaxYpos=scrollbarMc.getBounds().height-scrollTxtMc.getBounds().height;
			//console.log('scrollbarMc.getBounds(): ', scrollbarMc.getBounds(),', scrollTxtMc.getBounds(): ', scrollTxtMc.getBounds())
		}
		
		/* 팝업 내용 스크롤 이동 시 처리 */
		function popupScrollMove(ypos){
			var cha=ypos-scrollStartYpos;
			var sc=scrollbarStartYpos+cha;
			var ny=sc;
			if(sc<defaultScrollbarYpos){
				ny=defaultScrollbarYpos;
			}else if(sc>scrollMaxYpos){
				ny=scrollMaxYpos;
			}
			scrollTarget.y=ny;
			var per=ny/scrollMaxYpos;
			scrollTxtMc.y=-110+(scrollTxtMaxYpos*per);
			//console.log('scrollTxtMaxYpos   ',scrollTxtMaxYpos, per,'   ',scrollbarMc.y,'   ',scrollTxtMc.y);
		}
		
		/* 팝업 내용 스크롤바 세팅 */
		function setPopupScrollbar(){
			var i,nameList=['goverMc','marketMc','gameMc','supportMc','paperMc','mediaMc','defiMc'];
			var target,scrollbarHei,txtMcHei;
			
			console.log('setPopupScrollbar  main.countryCode: ', main.countryCode)
			for(i=0;i<7;i++){
				target=main.contentMc.container.popupBack[nameList[i]];
				if(main.countryCode=='KR'){
					target.txtMc.krTxtMc.visible=true;
					target.txtMc.usTxtMc.visible=false;
				}else{
					target.txtMc.krTxtMc.visible=false;
					target.txtMc.usTxtMc.visible=true;
				}
				scrollbarHei=target.scrollbarMc.getBounds().height;
				txtMcHei=target.txtMc.getBounds().height;
				
				console.log('scrollbarHei, txtMcHei : ', scrollbarHei, txtMcHei);
			
				if(txtMcHei<=scrollbarHei){
					target.scrollbarMc.visible=false;
				}else{
					target.scrollbarMc.visible=true;
				}
			}
		}
		
